	{ \
	if ( ! YY_CURRENT_BUFFER ){ \
        fortrancodeYYensure_buffer_stack (); \
		YY_CURRENT_BUFFER_LVALUE =    \
            fortrancodeYY_create_buffer(fortrancodeYYin,YY_BUF_SIZE ); \
	} \
	YY_CURRENT_BUFFER_LVALUE->yy_is_interactive = is_interactive; \
	}

