static int yy_init_globals (void)
{
   /* Initialization is the same as for the non-reentrant scanner.
   * This function is called from fortrancodeYYlex_destroy(), so don't allocate here.
   */

   (yy_buffer_stack) = 0;
   (yy_buffer_stack_top) = 0;
   (yy_buffer_stack_max) = 0;
   (yy_c_buf_p) = (char *) 0;
   (yy_init) = 0;
   (yy_start) = 0;

   (yy_start_stack_ptr) = 0;
   (yy_start_stack_depth) = 0;
   (yy_start_stack) =  NULL;

   (yy_state_buf) = 0;
   (yy_state_ptr) = 0;
   (yy_full_match) = 0;
   (yy_lp) = 0;

   /* Defined in main.c */
#ifdef YY_STDINIT
   fortrancodeYYin = stdin;
   fortrancodeYYout = stdout;
#else
   fortrancodeYYin = (FILE *) 0;
   fortrancodeYYout = (FILE *) 0;
#endif

   /* For future reference: Set errno on error, since we are called by
    * fortrancodeYYlex_init()
    */
   return 0;
}

/* fortrancodeYYlex_destroy is for both reentrant and non-reentrant scanners. */
int fortrancodeYYlex_destroy  (void)
{

   /* Pop the buffer stack, destroying each element. */
   while (YY_CURRENT_BUFFER) {
      fortrancodeYY_delete_buffer(YY_CURRENT_BUFFER  );
      YY_CURRENT_BUFFER_LVALUE = NULL;
      fortrancodeYYpop_buffer_state();
   }

   /* Destroy the stack itself. */
   fortrancodeYYfree((yy_buffer_stack) );
   (yy_buffer_stack) = NULL;

   /* Destroy the start condition stack. */
   fortrancodeYYfree((yy_start_stack)  );
   (yy_start_stack) = NULL;

   fortrancodeYYfree ( (yy_state_buf) );
   (yy_state_buf)  = NULL;

   /* Reset the globals. This is important in a non-reentrant scanner so the next time
    * fortrancodeYYlex() is called, initialization will occur. */
   yy_init_globals( );

   return 0;
}

